import React, { Component } from 'react';
import { BrowserRouter, Switch, Route, Link } from 'react-router-dom';
import LoginUsuario from './components/LoginUsuario';
import MiComponente from './components/MiComponente';
import Error from './components/Error';
import Index from './components/Index';

class Rutas extends Component {

    render() {

        return (
            <BrowserRouter>
                <div className="App">
                  <nav className="navbar navbar-expand-lg navbar-light fixed-top">
                    <div className="container">
                      <Link className="navbar-brand" to={"/LoginUsuario"}>positronX.io</Link>
                      <div className="collapse navbar-collapse" id="navbarTogglerDemo02">
                        <ul className="navbar-nav ml-auto">
                          <li className="nav-item">
                            <Link className="nav-link" to={"/LoginUsuario"}>Login</Link>
                          </li>
                          <li className="nav-item">
                            <Link className="nav-link" to={"/RegistrarUsuario"}>Sign up</Link>
                          </li>
                        </ul>
                      </div>
                    </div>
                  </nav>

                  <div className="auth-wrapper">
                    <div className="auth-inner">
                      <Switch>

                        <Route exact path= "/" component= {Index} /> 
                        <Route exact path= "/LoginUsuario" component= {LoginUsuario} />
                        <Route exact path= "/MiComponente" component= {MiComponente} />
                        <Route component= {Error} />

                      </Switch>
                    </div>
                  </div>
                </div></BrowserRouter>




        );



    }


}

export default Rutas;
